import Home from './Components/Home';



function App() {
  return (

    <Router>

    <div className="App">
    <Home/>


    <Routes> 
    <Route exact path="/" element={<Categories />} /> 
                              <Route path="/item" element={<Item />} /> 


                            </Routes>
    </div>
    </Router>

  );
}

export default App;
